import ReactDOM from 'react-dom/client';

const myelement = (
	<table>
	  <tr>
		<th>Name</th>
	  </tr>
	  <tr>
		<td>John</td>
	  </tr>
	  <tr>
		<td>Elsa</td>
	  </tr>
	</table>
  );

  ReactDOM.render(myelement, document.getElementById('root'));

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(myFirstElement);
